import styled from "styled-components";

import { Header } from "./components/header";
import { Navigation } from "./components/navigation";
import { TrainingCourses } from "./components/trainingCourses";

const Main = styled.div`
  display: flex;
`;


function App() {
  return (
    <div className="App">
      <Header />
      <Main>
        <Navigation />
        <TrainingCourses />
      </Main>

    </div>
  );
}

export default App;
